import { Component, OnInit } from '@angular/core';
import { GameService } from '../game.service';
import { AuthService } from '../auth.service';
import { Location } from '@angular/common';
import pdfMake from 'pdfmake/build/pdfmake';
import pdfFonts from 'pdfmake/build/vfs_fonts';
pdfMake.vfs = pdfFonts.pdfMake.vfs;

@Component({
  selector: 'app-create-campaign',
  templateUrl: './create-campaign.component.html',
  styleUrls: ['./create-campaign.component.css']
})
export class CreateCampaignComponent implements OnInit {
  char: string = "abcdefghijklmnopqrstuvwxyzABCDEFGHIJKLMNOPQRSTUVWXYZ0123456789"
  url: string = "np-tresor.web.app/c/CampaignCreatorTest";
  checkingurl: boolean = false;
  msg: string;
  error: boolean = false;
  pdfDownloaded: boolean = false;
  redirectTo: number;

  campaign: any = {
    id: "",
    backStory: [""],
    introText: [""],
    endText: [""],
    title: "",
    quest: [
      {questStory: [""], questData: {title:"", qr:`https://np-tresor.web.app/qr/${this.randomText()}`}}
    ]
  }

  stage: number = 0;

  keys = Object.keys;

  constructor(
    private gameService: GameService,
    private authService: AuthService,
    private location: Location
  ) { }

  ngOnInit() {
    
  }

  checkurl(counter=1){
    if (this.campaign.title.trim() != ""){
      this.checkingurl = true;
      this.url = "checking url availibility..."
      let id = "";
      id = `${this.campaign.title.replace(/ /g, "")}${counter>1?counter:""}`;
  
      this.gameService.CampaignExist(id).then(exist=>{
        if (exist){
          this.checkurl(counter+1);
        } else {
          this.url = `np-tresor.web.app/campaign/${id}`;
          this.campaign.id = id;
          this.checkingurl = false;
        }
      })
    } else {
      this.url = "Enter a campaign name!";
    }
  }

  test(){
    // console.log(this.campaign);
  }

  next(n:number){
    this.error = false;
    // console.log(this.campaign);
    this.stage+=n;
    if (this.stage<0)
      this.stage=0;
    else if (this.stage>3)
      this.stage=3;
    
    //next
    if (n>0){
      if (this.stage==2){
        this.submit();
      }
    } else {
      if (this.stage==1){
        this.stage = this.redirectTo
      } else if (this.stage==2){
        this.location.back()
      }
    }
  }


  randomText(){
    let rando = "";
    for (let i = 0; i < 32; i++) {
      rando += this.char[Math.floor(Math.random()*62)];
      
    }
    return rando;
  }

  submit() {
    console.log(this.campaign);
    let validity = this.CheckValidity()
    if (validity.isValid){
      this.msg = "Uploading...";
      this.gameService.CreateCampaign(this.campaign,this.authService.GetUserId()).then(_ =>{
        this.stage = 3;
      })
    } else {
      this.error = true;
      this.msg = validity.msg;
      this.redirectTo = validity.redirectTo;
    }
  }

  CheckIsActuallyEmpty(arr: Array<string>) {
    let isEmpty = true;
    arr.forEach(e => {
      if (e.trim() != ""){
        isEmpty = false;
        return;
      }
    });
    return isEmpty;
  }

  CheckQuestTitleIsInvalid() {
    let validQuestCount = 0;
    this.campaign.quest.forEach(q => {
      if (q.questData.title.trim() != "") {
        validQuestCount++;
        if (validQuestCount>1){
          return;
        }
      }
    });
    return validQuestCount<2;
  }

  CheckValidity() {
    let retnru = {isValid: false, msg: "test", redirectTo: 0};

    if (this.campaign.title.trim() == "")
      retnru.msg = "You must add a name for the campaign.";
    else if (this.CheckIsActuallyEmpty(this.campaign.backStory))
      retnru.msg = "You must have at least one backstory.";
    else if (this.CheckIsActuallyEmpty(this.campaign.endText))
      retnru.msg = "You must have at least one end story.";
    else if (this.CheckQuestTitleIsInvalid()){
      retnru.msg = "You must have at least two quests with a title.";
      retnru.redirectTo = 1;
    }
      
    else
      retnru.isValid = true;
    return retnru;
  }


  DownloadPDF(){
    const dd: any = {
      info: {
        title: `${this.campaign.title} QR Codes`
      },
      content: [
        {style: "id", fit:[400, 400], image:"data:image/png;base64,"},
        {text: "Hello! You have just created a campaign. Before sharing it, follow these 3 steps!\n\n"},
        {text: "1. Print this pdf (single sided)"},
        {text: "2. Cut out the QR codes"},
        {text: "3. Put them up at their respective locations\n\n"},
        {text: "You may refer to this table to check which QR code correspond to which quest.\n\n"},


        // {columns: [
        //   ['\n\nquest1\n\n',{ qr: 'text in QR', fit: '200'}],
        //   ['\n\nquest1\n\n',{ qr: 'text in QR', fit: '200'}]
        // ]},
        // {columns: [
        //   ['\n\nquest1\n\n',{ qr: 'text in QR', fit: '200'}],
        //   ['\n\nquest1\n\n',{ qr: 'text in QR', fit: '200'}]
        // ]},
        // {columns: [
        //   ['\n\nquest1\n\n',{ qr: 'text in QR', fit: '200'}],
        //   ['\n\nquest1\n\n',{ qr: 'text in QR', fit: '200'}]
        // ]}
      ],
      defaultStyle: {
        fontSize: 16
      },
      styles: {
        id: {
          color:'#555555',
          alignment: 'center',
          fontSize: 11
        }
      },

      footer: {
        style: 'id', text: `https://np-tresor.web.app/c/${this.campaign.id}`
      }
    }

    // create table
    const table:any = {
      table: {
        body: [["Id","Title"]]
      }, 
      pageBreak: 'after'
    }
    for (let i = 0; i < this.campaign.quest.length; i++)
      table.table.body.push([{text: `quest-${i+1}`, bold: true},this.campaign.quest[i].questData.title]);
    dd.content.push(table);


    // create qr codes
    for (let i=0; i<this.campaign.quest.length; i+=2){
      dd.content.push({
        columns: [
          [[{text:`\n\nquest-${i+1}\n\n`, style: "id"},{ qr: `${this.campaign.quest[i].questData.qr}`, fit: '200', style: "id"}]],
          [this.campaign.quest[i+1]?[{text:`\n\nquest-${i+2}\n\n`, style: "id"},{ qr: `${this.campaign.quest[i+1].questData.qr}`, fit: '200', style: "id"}]:[]]
        ]
      })
    }
    pdfMake.createPdf(dd).download(`${this.campaign.id}_QR_Codes`);

    this.pdfDownloaded = true;
    // pdfMake.createPdf(dd).open();
  }

  
}
